import React from 'react';
import { HashLink as Link } from 'react-router-hash-link';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'

const NavBar = () => {
    return (
        <NavBarContainer>
            <NavigationContainer>
                <Link to="#about"><NavigationButton>About</NavigationButton></Link>
                <NavigationButton></NavigationButton>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
